INSERT INTO `workspaces` VALUES ('139b821a-f5d0-49c8-9f26-da68e54d59a2','1000003',_binary '\0',NULL,'2025-07-04 08:16:02.078012',NULL,'2025-07-04 08:16:02.078012','1000003','<p>- Có các kiến thức cơ bản về lập trình thiết bị di động nói chung và android nói riêng</p><p>- Các kỹ thuật xây dựng giao diện băng XML, các mẫu thiết kế cho android</p><p>- Xây dựng ứng dung với các API của hệ điều hành thuộc Android bằng ngôn ngữ Java</p>','2025-04-25 17:00:00.000000','Nhập môn lập trình thiết bị di động ','2025-02-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea81','a15b3c2e-54c1-11f0-b992-0242ac150005'),('26b84f37-a0bb-4d11-8cc4-785e7707dfbb','1000005',_binary '\0',NULL,'2025-07-29 14:33:23.566173',NULL,'2025-08-21 22:59:08.999228','1000005','<p><br></p>','2025-08-18 23:59:59.999000','Lập trình Web','2025-07-29 14:32:57.165000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea89','a15b3bbe-54c1-11f0-b992-0242ac150005'),('792e6f85-582a-4f65-a50d-e7c59cefb7b2','1000002',_binary '\0',NULL,'2025-07-04 06:32:20.288462',NULL,'2025-07-04 06:32:20.288462','1000002','<p>- Có các kiến thức cơ bản về Website thương mại điện từ</p><p>- Hiểu biết về các khái niệm, kỹ thuật và mô hình mà các sàn thương mại điện tử hiện nay đang áp dụng</p><p>- Kiến thức để tự lên kế hoạch cho quá trinh xây dựng thương mại điện tử</p><p>- Sản phẩm website thương mại điện tử</p>','2025-04-26 17:00:00.000000','Thương mại điện tử','2025-02-09 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea79','a15b5475-54c1-11f0-b992-0242ac150005'),('80e07861-b2ba-4c27-88f7-b5ec46872474','1000005',_binary '\0',NULL,'2025-08-21 16:27:12.451116',NULL,'2025-08-21 16:27:12.451116','1000005','<p><br></p>','2025-09-10 23:59:59.999000','Lập trình Web (new)','2025-02-09 00:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea89','a15b3bbe-54c1-11f0-b992-0242ac150005'),('86a434ee-075e-406a-9098-aea8d4ae86f0','1000004',_binary '\0',NULL,'2025-08-03 06:53:58.112512',NULL,'2025-08-03 06:53:58.112512','1000004','<p>- Nắm được 4 nguyên tắc chính trong OOP</p><p>- Hiểu biết cơ bản về 12 mẫu thiết kế và mô hình MVC trong phát triển ứng dụng</p><p>- Có khả năng ứng dụng mẫu vào ứng dụng</p><p>- Có khả năng thiết kế Class diagram và kết hợp nhiều mẫu thiết kế với nhau</p>','2025-05-09 17:00:00.000000','Thiết kế hướng đối tượng 2025','2025-02-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea87','a15b3a4e-54c1-11f0-b992-0242ac150005'),('affedb6b-9a2b-4802-a48a-28a2db87aff7','1000005',_binary '\0',NULL,'2025-08-22 03:22:39.876793',NULL,'2025-08-22 03:22:39.876793','1000005','<p><br></p>','2025-05-24 23:59:59.999000','An toàn bảo mật','2025-02-08 00:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea89','a15b506c-54c1-11f0-b992-0242ac150005'),('f228ad1b-f250-41b6-ab6e-7979a8c78a52','1000001',_binary '\0',NULL,'2025-07-23 17:00:19.776077',NULL,'2025-07-23 17:00:19.776077','1000001','<p>Môn học cung cấp cho sinh viên các kiến thức về:</p><ol><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Các khái niệm về máy học</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Các bài toán phổ biến liên quan đến máy học như Phân loại, Hồi Quy, Gom cụm</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Các kiến thức về tiền xử lý dữ liệu</li><li data-list=\"bullet\"><span class=\"ql-ui\" contenteditable=\"false\"></span>Kiến thức cơ bản về Python và cách sử dụng API của các thư viên máy học</li></ol>','2025-05-04 17:00:00.000000','Machine Learning 2025','2025-02-08 17:00:00.000000','f3ee7d4d-d82b-45d8-8c46-6756b1b6ea69','a15b3eee-54c1-11f0-b992-0242ac150005');
